// function.js
import myAxios from "@/request";

//
export const bufferRegister = async (params) => {
  // 发起 POST 请求到 /api/user/register 路由，传递用户数据
  return myAxios.request({
    url: "function/buffer/",
    method: "POST",
    data: params,
  });
};
